function Main() {
  return (
    <div
      style={{  
        flex:1,
        backgroundColor: "#156082",
        width: "100%",
        height: "100vh",
        alignItems:"center",
        justifyContent:"center"
      }}
    >
        <div style={{alignItems:"center",textAlign:"center", width: "100%",
        height: "100vh",}}>
        <span style={{textAlign:"center", fontSize:"30px",color:"#fff"}}>Title</span>
        </div>
        <div style={{alignItems:"center",borderWidth:1, width: "100%",
        height: "100vh",}}>
        <span style={{textAlign:"center",  width: "100%",
        height: "100vh",fontSize:"30px",color:"#fff"}}>Title</span>
        </div>
    </div>
  );
}

export default Main;
